
const IND_o={service__v:()=>{navigator.serviceWorker.register("https://chercheurdart-2.netlify.app/service_worker.min.js",{scope:"/"}).then((()=>{}),(e=>console.log(`ServiceWorker registration failed [error: ${e}]`)))},listener__v:()=>{for(let e of["comment_label"]){const t=document.getElementById(e);t&&t.addEventListener("click",IND_o[`${e}__v`],{once:!0})}},main_input__v:()=>{for(let e of Array.from(document.querySelectorAll('[name="main_nav"]')))e.addEventListener("click",(()=>{location.hash&&(location.hash="")}))},comment_label__v:e=>{const t=document.getElementById("comment_iframe"),n=(t.contentDocument.body||t.contentDocument).children[0];document.getElementById("comments").appendChild(n),n.querySelector("#issue").value=t.dataset.issue_n,t.remove()}};IND_o.service__v(),window.onload=()=>{IND_o.listener__v(),IND_o.main_input__v()};